const person = {
    "name": "Ram",
    "address":{
        "village":"Royana",
        "City":"Nashik",
        "State":"Maharashtra"
    },
    "social":["twitter ", "linkedin ", "facebook ", "instagram "],
    profile : ()=>{
        person.social.map((profile)=>{
            console.log(profile)
        })
    }

}
// function profile(){
